import React from "react";
import Slider from "react-slick";
import { Carousel } from "react-responsive-carousel";
import "./index.css";
function Home() {
  const randimg = [
    {
      img: "https://picsum.photos/seed/img1/1000/400",
      alt: "cor1",
    },
    {
      img: "https://picsum.photos/seed/img2/1000/400",
      alt: "cor2",
    },
    {
      img: "https://picsum.photos/seed/img4/1000/400 ",
      alt: "cor3",
    },
  ];

  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Slider {...settings}>
      <div>
        <h3>1</h3>
      </div>
    </Slider>
  );
}

export default Home;
